import React from "react";

import "../public/styles/style.css";

function Interests(){
    return (
        <nav>
            <div className="container-4">
                <div className="left-2">
                    <div className="top-3">
                    </div>
                    <div className="bottom-3">
                    </div>
                </div>
                <div className="right-2">
                    <div className="top-4">
                    </div>
                    <div className="bottom-4">
                    </div>
                </div>
            </div>
        </nav>
    );
}
export default Interests;
